#define AVX256_X_BLOCK      ((PARAM_N)/16)

void common_shuffle(perm_t output, uniform_indexes_t input) {

    for (int i = PARAM_N - 1; i >= 0; --i) {

        // non AVX2 part
        uint16_t pi = input[i];
        output[i] = input[i];
        for (int j = i + 1; j < precomp_split[i]; ++j) {
            uint16_t mask = ISZERO(output[j] - pi);
            output[j] = MASKAPPLY(mask-1, i, output[j]);
        }

        // AVX2 part
        __m256i avxpi = _mm256_set1_epi16((int16_t)pi);
        __m256i avxi = _mm256_set1_epi16((int16_t)i);
        for (int j = precomp_div[i]; j < AVX256_X_BLOCK; ++j) {
            __m256i temp = _mm256_load_si256((const __m256i *)&output[j * 16]);
            __m256i avxmask = _mm256_cmpeq_epi16(temp, avxpi);
            temp = _mm256_xor_si256(temp, _mm256_and_si256(avxmask, _mm256_xor_si256(temp, avxi)));
            _mm256_store_si256((__m256i *)&output[j * 16], temp);
        }
    }
}
